void render_string(const char* s, float x, float y) {
    size_t i = 0;
    size_t buf_offset = 0;
    while (s[i] != '\0') {
        render_char(s[i], x, y, &buf_offset);
        x += bitmap_font_meta.x_advance;
        i++;
    }
}

void render_char(const char c, float x, float y,
                 size_t* buf_offset) {
    const int LINE_HEIGHT = 37;
    int width = bitmap_font_meta.chars[c - '!'].width;
    int height = bitmap_font_meta.chars[c - '!'].height;
    int tex_x = bitmap_font_meta.chars[c - '!'].x;
    int tex_y = bitmap_font_meta.chars[c - '!'].y;
    int x_offset = bitmap_font_meta.chars[c - '!'].x_offset;
    int y_offset = bitmap_font_meta.chars[c - '!'].y_offset;

    // TODO: lots of dups, should use index drawing
    float full_quad[] = {
        x + x_offset, y + y_offset,
        width, height,
        tex_x, tex_y,

        x + bitmap_font_meta.x_advance, y + y_offset,
        width, height,
        tex_x + width, tex_y,

        x + x_offset, y + LINE_HEIGHT,
        width, height,
        tex_x, tex_y + height,

        x + bitmap_font_meta.x_advance, y + y_offset,
        width, height,
        tex_x + width, tex_y,

        x + bitmap_font_meta.x_advance, y + LINE_HEIGHT,
        width, height,
        tex_x + width, tex_y + height,

        x + x_offset, y + LINE_HEIGHT,
        width, height,
        tex_x, tex_y + height,
    };
    glBufferSubData(GL_ARRAY_BUFFER, *buf_offset, sizeof(full_quad),
                    full_quad);
    *buf_offset += sizeof(full_quad);
}

GLuint font_init(void) {
    GLuint texture;
    glGenTextures(1, &texture);
    glBindTexture(GL_TEXTURE_2D, texture);
    glTexImage2D(GL_TEXTURE_2D, 0, GL_RGB, bitmap_font_img.width,
                 bitmap_font_img.height, 0, GL_RGB, GL_UNSIGNED_BYTE,
                 bitmap_font_img.img);
    glGenerateMipmap(GL_TEXTURE_2D);
    return texture;
}
